import React, { Component } from "react";
import Title from "../Title";

export default class CustomerAccount extends Component {
    state = {};
    render() {
        return (
            <React.Fragment>
                <div className="py-5">
                    <div className="container">
                        <Title name="Kill" title="Me" />
                        <div className="row"></div>
                    </div>
                </div>
            </React.Fragment>
        );
    }
}
